model.entr_warehouse.openoa_dim_table_me.raw_sql:
{% set property_keys = ['plant_id'] %}

{% set avail_model = {
    'model_name': ref('int_openoa_plant_curtail_avail_data__filtered'),
    'openoa_alias': 'curtail',
