} %}

{% set reanalysis_model = {
    'model_name': ref('int_openoa_reanalysis_data__filtered'),
    'openoa_alias': 'reanalysis',
} %}

{% set models = [avail_model, meter_model, scada_model, reanalysis_model] %}

{% for mdl in models %}

    select
        distinct
            '{{ mdl.openoa_alias }}' as table_name,
