model.entr_warehouse.openoa_wtg_scada.raw_sql:
{{
    config(materialized='table')
}}

-- OpenOA currently accepts data in the format generated by this projection
-- of the underlying entr data store.
{% set src_model = 'int_openoa_wtg_scada__flagged' %}
{% set keys = [ 'plant_id', 'plant_name', 'wind_turbine_id', 'wind_turbine_name', 'date_time'] %}
{% set tag_cols = dbt_utils.get_column_values(table=ref(src_model), column='entr_tag_name') %}

with
    src as (select * from {{ ref(src_model) }}),

piv as (
    select
        {{ jinja_list_to_sql(keys) }},
        {{  
            dbt_utils.pivot(
                column = 'entr_tag_name',
                values = tag_cols,
                then_value = 'tag_value',
                else_value = 'null',
                agg = 'avg',
                quote_identifiers = true) 
        }},
        {{  
            dbt_utils.pivot(
                column = 'entr_tag_name',
                values = tag_cols,
                then_value = 'flag_min_max_tag_value',
                else_value = 'null',
                agg = 'sum',
                quote_identifiers = true,
                prefix='flag_min_max_') 
        }},
        {{  
            dbt_utils.pivot(
                column = 'entr_tag_name',
                values = tag_cols,
                then_value = 'flag_stale_tag_value',
                else_value = 'null',
                agg = 'sum',
                quote_identifiers = true,
                prefix='flag_stale_') 
        }}
    from src
    {{ dbt_utils.group_by(n=keys|length) }}
)

select * from piv

model.entr_warehouse.int_openoa_reanalys.raw_sql:
{% set src_relation = ref('fct_entr_reanalysis_data') %}

with
    src as (select * from {{src_relation}}),
    reanalysis_dim as (select * from {{ ref('dim_asset_reanalysis_dataset') }}),
    plant_dim as (select * from {{ ref('dim_asset_wind_plant') }}),
    tag_dim as (select * from {{ ref('dim_entr_tag_list') }}),

src_filt as (
    select * from src
    where entr_tag_id in (2556, 2557, 2558, 2559, 2560, 2561, 2562)
),

{% set src_colnames = get_list_of_columns(src_relation)|map('lower')|list %}
{% set coalesce_fields = ['tag_value', 'value_type', 'value_units'] %}
derived_tags_join as (
    select
        {% for col in src_colnames %}
            {% if col in coalesce_fields %}
                coalesce(src_filt.{{col}}, wd.{{col}}) as {{col}}
            {% else %}
                {{col}}
            {% endif %}{% if not loop.last %}, {% endif %}
        {% endfor %}
    from src_filt
    full outer join ({{entr_reanalysis_wind_direction_from_components('src')}}) wd
        using({{ jinja_list_to_sql( src_colnames|reject('in', coalesce_fields)|list ) }})
)

select
    plant_dim.plant_name,
    reanalysis_dim.reanalysis_dataset_name,
    tag_dim.entr_tag_name,
    derived_tags_join.*
from derived_tags_join
left join reanalysis_dim using(reanalysis_dataset_id)
left join plant_dim using(plant_id)
left join tag_dim using(entr_tag_id)

